import React from 'react';
import FavouriteItem from './FavouriteItem';

const FavouriteList = props => {
  const list = props.favouriteList;
  console.log(list);
  return (
    <div>
      <ul>
        if(list) {
        list.map((listItem, index) => 
          <FavouriteItem  key={index} listAnime={listItem.anime} listCharacter={listItem.character} listQuote={listItem.quote} favouriteList={props.favouriteList} setFavouriteList={props.setFavouriteList}/>
        )}
      </ul>
    </div>);
}

export default FavouriteList;
